PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?dog ?dogLabel ?age WHERE {
  ?dog wdt:P31 wd:Q144 ; wdt:P570 ?dateOfDeath ; wdt:P569 ?dateOfBirth .
  BIND( YEAR( ?dateOfDeath ) - YEAR( ?dateOfBirth ) AS ?age ) OPTIONAL {
    ?dog rdfs:label ?dogLabel FILTER ( LANG( ?dogLabel ) = "en" )
  }
}
ORDER BY DESC ( ?age )
OFFSET 1
LIMIT 1

