SELECT ?founder ?founderLabel WHERE {
  wd:Q95 wdt:P112 ?founder .
  OPTIONAL {
    ?founder rdfs:label ?founderLabel FILTER ( LANG( ?founderLabel ) = "en" )
  }
}

