PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
PREFIX p: <http://www.wikidata.org/prop/>
PREFIX ps: <http://www.wikidata.org/prop/statement/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?adminEntity ?adminEntityLabel ?startTime ?endTime WHERE {
  wd:Q641 p:P131 ?statement .
  ?statement ps:P131 ?adminEntity .
  OPTIONAL {
    ?statement pq:P580 ?startTime
  }
  OPTIONAL {
    ?statement pq:P582 ?endTime
  }
  ?adminEntity wdt:P17 wd:Q131964 .
  ?adminEntity rdfs:label ?adminEntityLabel .
  FILTER ( LANG( ?adminEntityLabel ) = "en" )
}
LIMIT 10

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?work ?workLabel WHERE {
  {
    wd:Q1621261 wdt:P1441 ?work
  } UNION {
    ?work wdt:P674 wd:Q1621261
  }
  .
  ?work rdfs:label ?workLabel FILTER ( CONTAINS( LCASE( ?workLabel ) , "spider-man" ) )
}

